class Solution {
    func minGroupsForValidAssignment(_ nums: [Int]) -> Int {
        var frequency = [Int: Int]()
        for num in nums {
            frequency[num, default: 0] += 1
        }
        let frequencies = frequency.values.sorted(by: >)
        var groups = 0
        var i = 0
        while i < frequencies.count {
            groups += 1
            var capacity = 1
            var j = i + 1
            while j < frequencies.count, capacity < frequencies[i] {
                capacity += 1
                j += 1
            }
            i = j
        }
        return groups
    }
}
